import React from 'react';
import './ResultsSection.css';
import { TriageState } from '../types/TriageTypes';

interface ResultsSectionProps {
  triageState: TriageState;
}

const ResultsSection: React.FC<ResultsSectionProps> = ({ triageState }) => {
  const getESIClass = (esi: string | null) => {
    if (!esi) return '';
    const level = esi.includes('level_') ? 
      Number(esi.split('_')[1]) : 
      Number(esi.split('-')[1]);
    return `esi-${level}`;
  };

  const getDotColor = (esi: string | null) => {
    if (!esi) return 'green';
    const level = esi.includes('level_') ? 
      Number(esi.split('_')[1]) : 
      Number(esi.split('-')[1]);
    if (level <= 2) return 'red';
    if (level === 3) return 'yellow';
    return 'green';
  };

  const renderList = (data: any[] | { primary?: any[]; secondary?: any[]; vital_instability?: any[] }) => {
    if (Array.isArray(data)) {
      return data.map((item, index) => (
        <li key={index}>{item}</li>
      ));
    }

    if (data && typeof data === 'object') {
      const items: JSX.Element[] = [];
      let keyCounter = 0;

      if (data.primary && data.primary.length > 0) {
        items.push(
          <li key={keyCounter++} style={{ color: 'var(--danger)' }}>
            <strong>Birincil:</strong>
          </li>
        );
        data.primary.forEach((item: any) => {
          items.push(
            <li key={keyCounter++} style={{ marginLeft: '1rem', color: 'var(--danger)' }}>
              • {item}
            </li>
          );
        });
      }

      if (data.secondary && data.secondary.length > 0) {
        items.push(
          <li key={keyCounter++} style={{ color: 'var(--warning)' }}>
            <strong>İkincil:</strong>
          </li>
        );
        data.secondary.forEach((item: any) => {
          items.push(
            <li key={keyCounter++} style={{ marginLeft: '1rem', color: 'var(--warning)' }}>
              • {item}
            </li>
          );
        });
      }

      if (data.vital_instability && data.vital_instability.length > 0) {
        items.push(
          <li key={keyCounter++} style={{ color: 'var(--danger)' }}>
            <strong>Vital İnstabilite:</strong>
          </li>
        );
        data.vital_instability.forEach((item: any) => {
          items.push(
            <li key={keyCounter++} style={{ marginLeft: '1rem', color: 'var(--danger)' }}>
              • {item}
            </li>
          );
        });
      }

      return items;
    }

    return null;
  };

  const renderQuestions = (data: any[] | { primary?: any[]; secondary?: any[] }) => {
    if (Array.isArray(data)) {
      return data.map((item, index) => (
        <li key={index}>{item}</li>
      ));
    }

    if (data && typeof data === 'object') {
      const items: JSX.Element[] = [];
      let keyCounter = 0;

      if (data.primary && data.primary.length > 0) {
        data.primary.forEach((item: any) => {
          items.push(
            <li key={keyCounter++} style={{ color: 'var(--primary)' }}>
              {item}
            </li>
          );
        });
      }

      if (data.secondary && data.secondary.length > 0) {
        data.secondary.forEach((item: any) => {
          items.push(
            <li key={keyCounter++} style={{ color: 'var(--text-secondary)' }}>
              {item}
            </li>
          );
        });
      }

      return items;
    }

    return null;
  };

  const esiClass = getESIClass(triageState.triage?.triage_level);
  const dotColor = getDotColor(triageState.triage?.triage_level);

  return (
    <aside className="card results-section">
      <h2>Değerlendirme Sonuçları</h2>
      
      {/* Durum Özeti */}
      <div className={`result-summary ${esiClass}`}>
        <div className="status-indicator">
          <span className={`dot ${dotColor}`}></span>
          <span className="status-text">Değerlendirme Durumu</span>
        </div>
        <div className="badges-container">
          <span className={`badge ${esiClass}`}>
            ESI: {triageState.triage?.triage_level || '-'}
          </span>
          <span className="badge secondary">
            Öncelik: {triageState.triage?.routing?.priority || '-'}
          </span>
          <span className="badge tertiary">
            Bölüm: {triageState.triage?.routing?.specialty || '-'}
          </span>
        </div>
      </div>

      {/* Değerlendirme Açıklaması */}
      <div className="rationale-section">
        <h3>Değerlendirme Açıklaması</h3>
        <div className="rationale-content">
          {triageState.triage?.rationale_brief || 'Henüz değerlendirme yapılmadı. Hasta bilgilerini girin ve değerlendirmeyi başlatın.'}
        </div>
      </div>

      <div className="hr"></div>
      
      {/* Kritik Bulgular */}
      <div className="section-block">
        <h3>Kritik Bulgular (Red Flags)</h3>
        <ul className="findings-list">
          {renderList(triageState.triage?.red_flags || [])}
        </ul>
      </div>

      <div className="hr"></div>
      
      {/* İlk Müdahaleler */}
      <div className="section-block">
        <h3>İlk Müdahaleler</h3>
        <ul className="findings-list">
          {renderList(triageState.triage?.immediate_actions || [])}
        </ul>
      </div>

      <div className="hr"></div>
      <div>
        <strong>Sorulacak ek sorular (güncel)</strong>
        <ul className="findings-list">
          {renderQuestions(triageState.triage?.questions_to_ask_next || [])}
        </ul>
      </div>
    </aside>
  );
};

export default ResultsSection;
